import React from 'react'
import './Model.css'
import {CopyToClipboard} from 'react-copy-to-clipboard'
import { useState } from 'react'


 
export default function Model({open, onClose, hours,minutes,seconds, attempts,currentattempts, complete, correct, percent, streak}) {
    if(!open) return null
   
    const [copy, setCopy] = useState(false)
    const [sharebut, setSharebut] = useState(false)
    
    async function p() {
      if(currentattempts === undefined)
      {
        setSharebut(false)
      }
      if(currentattempts === 5)
      {
        setSharebut(true)
      }
      if(complete === true)
      {
        setSharebut(true)
      }
    }
    
  return(
    
     <div className='overlay'>
    <div className='container'>
        <div className='container2' onClick={onClose}><svg xmlns="http://www.w3.org/2000/svg" height="48" width="48"><path d="m12.45 37.65-2.1-2.1L21.9 24 10.35 12.45l2.1-2.1L24 21.9l11.55-11.55 2.1 2.1L26.1 24l11.55 11.55-2.1 2.1L24 26.1Z"/></svg></div>
        <h1 className='head'>Your Stats</h1>
        <div className='containstats'>
        
        </div>
        <div className='timeleft'>Next Tweetle in 00:00:00 </div>
       {sharebut &&  <CopyToClipboard text={'Daily Tweetle ' + currentattempts + '/5'} onCopy={() => setCopy(true)}><div className='sharecontainer'><div className='share'><div className='sharetext'><span class="material-symbols-outlined">
{copy ? 'Copied' : "share"}
</span></div></div></div></CopyToClipboard>} 
        
        <div className='containercontainer'>
          <div className='attemptcontainer'>
            <div className='attempts'>{correct} / {attempts}</div>
            <div className='attempts2'>Attempts</div>
          </div>
          <div className='streakcontainer'>
             <div className='streaknum'>{streak}</div>
              <div className='streak'>Longest Streak</div>
          </div>
          <div className='wincontainer'>
            <div className='percent'>{percent.toFixed(0)}% </div>
                <div className='winpercent'>Win Percentage</div> 
          </div>
        </div>
         
        <div className='statcontainer'>
          <div className='gamesplayed'></div>
          <div className='streak'></div>



        </div>
   </div>
   </div>
   
  )

}
